class WeekWeather extends Component {
    state = {  }
    render() { 
        return ( 
            <React.Fragment>
            <div className="weeks-weather">
                <h2>This Week</h2>
                </div>

            <div className="weeks-weather">
                 {this.props.weather.map((item,i) =>
                     <ul>
                        <li>{item[0]} </li>
                        <li><img src={`http://openweathermap.org/img/w/${item[1]}.png`}/></li>
                        <li>{item[2]}</li>
                        <li> {item[3]}&#176;/{item[4]}&#176;</li>

                        </ul>
                        )} 
            </div>
            </React.Fragment>
         );
    }
}

export default WeekWeather;
